class Node:
    def __init__(self,itvl,val=0,left=None,right=None):
        self.val = val 
        self.left = left
        self.right = right
        self.itvl = itvl

class SegmentTree:
    def __init__(self,arr):
        self.arr = arr
        self.root = self._build(arr)

    def get_sum(self,l,r):
        return self._calculate(self.root,l,r)

    def update(self,i,val):
        return self._change(self.root,i,val)

    def _build(self,arr):
        l = 0
        r = len(arr)-1
        return self._propagate((l,r))

    def _propagate(self,itvl):
        l,r = itvl
        node = Node(itvl)

        if l==r:
            node.val = self.arr[l]
        else:   
            node.left = self._propagate((l,(l+r)//2))
            node.right = self._propagate(((l+r)//2+1,r))
            node.val = node.left.val+node.right.val
        return node
    def _calculate(self,node,l,r):
        print(node.val)
        if self._contains((l,r),node.itvl):
            return node.val
        elif self._overlaps((l,r),node.itvl):
            return self._calculate(node.left,l,r)+self._calculate(node.right,l,r)
        else:
            return 0
    
    def _change(self,node,i,val):
        l,r = node.itvl
        if l==r and l==i:
            diff = val - node.val
            node.val = val
            return diff
        elif self._contains(node.itvl,(i,i)):
            diff = self._change(node.left,i,val)+self._change(node.right,i,val)
            node.val+=diff
            return diff
        return 0

    def _contains(self,itvl1,itvl2):
        l1,r1 = itvl1
        l2,r2 = itvl2
        return l1<=l2<=r1 and l1<=r2<=r1
    def _overlaps(elf,itvl1,itvl2):
        l1,r1 = itvl1
        l2,r2 = itvl2
        return l2<=l1<=r2 or l2<=r1<=r2

